import React,{useState} from 'react'
import Navbar from '../Navbar'
import UserDashboard from '../UserDashboard/UserDashboard'


function User() {

   const [click,setClick]=useState(false);

  return (
    <div>
      <Navbar />
      <UserDashboard  click={click} setClick={setClick}/>
    </div>
  )
}

export default User
